__NUXT_JSONP__("/gallery/dont-stop-zincing", (function(a,b,c,d){return {data:[{document:{date:b,title:[{type:"heading3",text:"Don't Stop Zincing!",spans:[]}],photo:{dimensions:{width:c,height:c},alt:b,copyright:b,url:"https:\u002F\u002Fimages.prismic.io\u002Ffunk\u002Fba76c56c-3b09-4be9-98ff-f8d6c9ef5551_DontStop.jpg?auto=compress,format&rect=0,0,2000,2000&w=800&h=800",small:{dimensions:{width:d,height:d},alt:b,copyright:b,url:"https:\u002F\u002Fimages.prismic.io\u002Ffunk\u002Fba76c56c-3b09-4be9-98ff-f8d6c9ef5551_DontStop.jpg?auto=compress,format&rect=0,0,2000,2000&w=320&h=320"}},content:[{type:a,text:"This is a project I did for my son in law’s brother who works for a Canadian mining company.",spans:[]},{type:a,text:"The  idea was that coating with zinc prevents rust, and he wanted to bring  in the Fleetwood Mac Lyric “Don’t stop thinking about tomorrow” changing  it to “Don’t stop ZINCING”!",spans:[]},{type:a,text:"The rest he left up to me to do a logo for the campagne. ",spans:[]},{type:a,text:"I bought a picture of the Tin Woodsman from The Wizard Of Oz from  an image bank and layer merged a photo of rusted metal on his left  side. I did the lettering in Photoshop, as well as the brushed texture  on the axe with the element specs for zinc.",spans:[{start:44,end:60,type:"em"}]},{type:a,text:"Seems it was a big hit. But I neva got the T-shirt.",spans:[]},{type:a,text:"Such is life. Grin & zinc it.",spans:[]},{type:a,text:"Processing done in Photoshop CS4",spans:[]}],tag:"montage"}}],fetch:[],mutations:void 0}}("paragraph",null,800,320)));